import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { IconName } from "react-icons/fa";
import { Link } from 'react-router-dom';

import './Header.css';

const Header = () => {
    return (
        <header>
        <div class="nav-bar">
        <Link to='/home' class="logo"><img src="/images/promaniq22.png" alt=""/></Link>
            <div class="navigation">
                <div class="nav-items">
                    <i class="uil uil-times nav-close-btn"></i>
                    <Link href="/home"><IconName class="uil uil-home"></IconName> Home</Link>
                    <Link to="/catalog"><i class="uil"></i> Explore</Link>
                    <Link to="/blog"><i class="uil uil-document-layout-left"></i> Blog</Link>
                    <Link to="/login"><i class="uil uil-envelope"></i> Login</Link>


                </div>
            </div>
            <i class="uil uil-apps nav-menu-btn"></i>
        </div>
    </header>
    );
};

export default Header;
